create table uaa_service_menu
(
    SERVICE_ID  varchar(36) charset utf8mb4 not null comment '模块id',
    MENU_ID     varchar(36) charset utf8mb4 not null comment '菜单id',
    CREATE_TIME datetime                    null comment '创建时间',
    primary key (SERVICE_ID, MENU_ID)
)
    comment '服务绑定菜单关联表' collate = utf8mb4_unicode_ci
                                 row_format = DYNAMIC;

